import React, { Component } from "react";
import Navbar from "./navbar";

class Profile extends Component {
  state = {
    user: { ...this.props.user }
  };
  render() {
    console.log(this.state.user);
    return (
      <div>
        <Navbar />
      </div>
    );
  }
}

export default Profile;
